data.text:
@ariyadhiah أمام نيوكاسل غدًا الأحد في الجولة الثالثة من البريميرليج.

وأشارت إلى أن اللاعب بعد اللقاء ضد نيوكاسل سيتوجه إلى مدينة دبي الإماراتية لإجراء الكشف الطبي تمهيدًا لانضمامه للإتحاد.

وبالتالي ستنتهي تجربة إستثنائية خاضها صلاح مع ليفربول ويبدأ تجربة

